function getD(dates){var dd = new Date(); var n = dates || 0; dd.setDate(dd.getDate() + n); var y = dd.getFullYear(); var m = dd.getMonth() + 1; var d = dd.getDate(); m = m < 10 ? "0" + m: m; d = d < 10 ? "0" + d: d; var day = y + "-" + m + "-" + d; return day;}//getD(dates)  //dates0,-11yyyy-mm-dddates
function getYQMW(date,type){var datex; switch(type){
	  case "W": var date2=new Date(date.getFullYear(), 0, 1); var day1=date.getDay(); if(day1==0) day1=7; var day2=date2.getDay(); if(day2==0) day2=7; 
                d = Math.round((date.getTime() - date2.getTime()+(day2-day1)*(24*60*60*1000)) / 86400000);
				var ww=Math.ceil(d /7)+1
				datex="W"+date.getFullYear() + " " + (ww < 10 ? "0" + ww: ww);break;
	  case "M": datex="M"+date.split("-")[0]+"-"+date.split("-")[1]; break;
	  case "Q": datex="Q"+date.split("-")[0]+"Q"+'111222333444'.charAt(date.split("-")[1]*1); break;
	  case "Y": datex="Y"+date.split("-")[0]; break;
  }return datex;}//getYQMW(new Date("2020-01-08"),W) //getYW(yyyy-mm-dd,W)   Q M Y


function getW(type, dates){var now = new Date(); var nowTime = now.getTime(); var day = now.getDay(); var longTime = 24 * 60 * 60 * 1000; var n = longTime * 7 * (dates || 0); if(type == "s"){var dd = nowTime - (day - 1) * longTime + n;}; if(type == "e"){var dd = nowTime + (7 - day) * longTime + n;}; dd = new Date(dd); var y = dd.getFullYear(); var m = dd.getMonth() + 1; var d = dd.getDate(); m = m < 10 ? "0" + m: m; d = d < 10 ? "0" + d: d; var day = y + "-" + m + "-" + d; return day;}
//getW(type,dates)  //type"s","e"dates0-11
//getW("s",1)  //yyyy-mm-dd
//getW("e",1)  //yyyy-mm-dd

function getM(type, months){var d = new Date(); var year = d.getFullYear(); var month = d.getMonth() + 1;
    if (Math.abs(months) > 12){months = months % 12;}
    if(months != 0){
        if (month + months > 12){year++; month = (month + months) % 12;}
        else if(month + months < 1){year--; month = 12 + month + months;}
        else{month = month + months;} }
    month = month < 10 ? "0" + month: month;
    var date = d.getDate();
    var firstday = year + "-" + month + "-" + "01";
    var lastday = "";
    if (month == "01" || month == "03" || month == "05" || month == "07" || month == "08" || month == "10" || month == "12"){lastday = year + "-" + month + "-" + 31;}
	else if(month == "02"){
        if ((year % 4 == 0 && year % 100 != 0) || (year % 100 == 0 && year % 400 == 0)){lastday = year + "-" + month + "-" + 29;}
		else{lastday = year + "-" + month + "-" + 28;}
    }else{lastday = year + "-" + month + "-" + 30;}
    var day = "";
    if (type == "s"){day = firstday;}else {day = lastday;}
    return day;} 
//getM(type,months)  //type"s","e"months0-11
//getM("s",1)  //yyyy-mm-dd
//getM("e",1)  //yyyy-mm-dd

function getY(type,dates){var dd = new Date(); var n = dates || 0; var year = dd.getFullYear() + Number(n); 
    if (type == "s"){var day = year + "-01-01";};
    if (type == "e"){var day = year + "-12-31";};
    if (!type){var day = year + "-01-01/" + year + "-12-31";};return day;}; 
//getY(type,dates)  //type"s","e"dates0-11
//getY("s",1)  //yyyy-mm-dd
//getY("e",1)  //yyyy-mm-dd

function getQ(type,dates){var now = new Date(); var nowMonth = now.getMonth(); var year = now.getFullYear(); var quarterStartMonth = 1;
 if(dates==-1){
  if(nowMonth<3){quarterStartMonth = 10;}  
  if(2<nowMonth && nowMonth<6){quarterStartMonth = 1;}     
  if(5<nowMonth && nowMonth<9){quarterStartMonth = 4;}     
  if(nowMonth>8){quarterStartMonth = 7;} 
  if (type == "s"){if(quarterStartMonth==10){year=year-1;} var day = year+"-"+getNow(quarterStartMonth)+"-01";};//1-3 4-6 7-9 10-12
  if (type == "e"){
	  if(quarterStartMonth==1){var day = year+"-"+getNow(quarterStartMonth+2)+"-31";}
	  if(quarterStartMonth==4){var day = year+"-"+getNow(quarterStartMonth+2)+"-30";}
	  if(quarterStartMonth==7){var day = year+"-"+getNow(quarterStartMonth+2)+"-30";}
	  if(quarterStartMonth==10){year=year-1; var day = year+"-"+getNow(quarterStartMonth+2)+"-31";}
  };
 }else{
  if(nowMonth<3){quarterStartMonth = 1;}  
  if(2<nowMonth && nowMonth<6){quarterStartMonth = 4;}     
  if(5<nowMonth && nowMonth<9){quarterStartMonth = 7;}     
  if(nowMonth>8){quarterStartMonth = 10;} 
  if (type == "s"){var day = year+"-"+getNow(quarterStartMonth)+"-01";};//1-3 4-6 7-9 10-12
  if (type == "e"){
	  if(quarterStartMonth==1){var day = year+"-"+getNow(quarterStartMonth+2)+"-31";}
	  if(quarterStartMonth==4){var day = year+"-"+getNow(quarterStartMonth+2)+"-30";}
	  if(quarterStartMonth==7){var day = year+"-"+getNow(quarterStartMonth+2)+"-30";}
	  if(quarterStartMonth==10){var day = year+"-"+getNow(quarterStartMonth+2)+"-31";}
  }
 } return day;} 
//getQ("s",0)  //yyyy-mm-dd -1
//getQ("e",0)  //yyyy-mm-dd  -1

// date("2020-08-08","sql");//20200808     date("20200808","s");//2020-08-08
function date(str,type){if(type=="sql"){var restr=str.replace(/-/g,"");}else{
	if(str!="0"){var restr=str.substr(0,4)+"-"+str.substr(4,2)+"-"+str.substr(6,2);}else{restr="";}}
	if(restr=="--"){restr="";} return restr;}
//
function getNow(s){return s < 10 ? '0' + s: s;}
function nowtime(str){
	var myDate = new Date();
	var year=myDate.getFullYear();
	var month=getNow(myDate.getMonth()+1);
	var date=getNow(myDate.getDate()); 
	var h=getNow(myDate.getHours());//(0-23)
	var m=getNow(myDate.getMinutes());//(0-59)
	var s=getNow(myDate.getSeconds());
	switch(str){
		case "yl": return year+""+month+""+date;break;//nowtime("yl");
		case "YX": return year;break;
		case "MX": return month;break;
		case "DX": return date;break;
		case "tl": return h+":"+m+":"+s;break;
		case "yt": return year+"-"+month+"-"+date;break;
		case "ytx": return year+""+month;break;
		case "y": return year+"-"+month+"-"+date+" "+h+":"+m+":"+s;break;
		case "yx": return year+""+month+""+date+""+h+""+m+""+s;break;
		case "ym": return year+"-"+month+"-"+date+" "+h+":"+m;break;
		case "t": return h+":"+m+":"+s;break;
		case "tt": return h+""+m+""+s;break;
		case "week": return "".charAt(new Date().getDay());break;
		default: return year+"-"+month+"-"+date+" "+h+":"+m+":"+s;break; } }	

function rgbTohex(rgb){//rgb  hex #000000 //rgbTohex($("#color1").css("background-color"))
	    if(rgb.indexOf("rgb") >= 0){rgb = rgb.match(/^rgb\((\d+),\s*(\d+),\s*(\d+)\)$/);
        function hex(x){return ("0" + parseInt(x).toString(16)).slice(-2).toUpperCase();}
        return hex(rgb[1]) + hex(rgb[2]) + hex(rgb[3]); //"#" + 
		}else{return rgb;}    }
	
function sum(m,n){var num = Math.floor(Math.random()*(m - n) + n); return num;}//sum(1,82) m n

jQuery.fn.selectText = function(){//   //$(document).ready(function(){$("#div").selectText();})
    this.find('input').each(function() {
        if($(this).prev().length == 0 || !$(this).prev().hasClass('p_copy')) { 
            $('<p class="p_copy" style="position: absolute; z-index: -1;"></p>').insertBefore($(this));
        }
        $(this).prev().html($(this).val());
    });
    var doc = document;
    var element = this[0];
    console.log(this, element);
    if (doc.body.createTextRange) {
        var range = document.body.createTextRange();
        range.moveToElementText(element);
        range.select();
    } else if (window.getSelection) {
        var selection = window.getSelection();        
        var range = document.createRange();
        range.selectNodeContents(element);
        selection.removeAllRanges();
        selection.addRange(range);
    }
};
