$(document).delegate(".OS_num",'mousewheel DOMMouseScroll',function(event){
	    var changeval=1; if(typeof($(this).attr("data-cval"))!="undefined"){changeval=$(this).attr("data-cval");}
	    var minval=$(this).attr("data-mval") || 0; if(typeof($(this).attr("data-mval"))!="undefined"){changeval=$(this).attr("data-mval");}
        var wheel = event.originalEvent.wheelDelta;/*Chorme*/
        var detal = event.originalEvent.detail;
        if (event.originalEvent.wheelDelta) {/*IE, */              
            if (wheel > 0){$(this).text($(this).text()*1+changeval*1).focus();}  
            if (wheel < 0 && ($(this).text()*1-changeval*1)>minval){$(this).text($(this).text()*1-changeval*1).focus();}
        }else if (event.originalEvent.detail) {/*Firefox */ 
            if (detal > 0){$(this).text($(this).text()*1+mousewheel[2]*1).focus();}  
            if (detal < 0 && ($(this).text()*1-changeval*1)>minval){$(this).text($(this).text()*1-changeval*1).focus();} } });
